//for Debugging purposes 
void Heartbeat_Init(void){
	volatile uint8_t delay=0;
	SYSCTL_RCGCGPIO_R |= 0x20;
	delay=42;
	GPIO_PORTF_DIR_R |= heartbeat;
	GPIO_PORTF_AFSEL_R &= ~heartbeat;
	GPIO_PORTF_DEN_R |= heartbeat;
}


//toggle LED
void Heartbeat(void){
	GPIO_PORTF_DATA_R ^= heartbeat;
	}

	
//Pause Button: PA2
//Main Menu Button: PA3
//Swap Player Button: PA4
void Button_Init(void){
	//set PA2-PA4
	//PA2 pause will be edge interrupt (on release)
	SYSCTL_RCGCGPIO_R |= 0x1;
	GPIO_PORTA_DIR_R   &= ~buttons;
	GPIO_PORTA_AFSEL_R &= ~buttons;
	GPIO_PORTA_DEN_R 	 |= buttons;
	GPIO_PORTA_PDR_R 	 |= buttons;
	GPIO_PORTA_AMSEL_R = 0;
	//EDGE INTERRUPT ON PAUSE BUTTON
  GPIO_PORTA_IS_R &= pause_button;     //PA is edge-sensitive
  GPIO_PORTA_IBE_R &= ~pause_button;    //PA2 is not both edges
  GPIO_PORTA_IEV_R &= ~pause_button;    //PA2 falling edge event
  GPIO_PORTA_ICR_R = pause_button;      //clear flag2
  GPIO_PORTA_IM_R |= pause_button;      //arm interrupt on PA2 
  NVIC_PRI0_R = (NVIC_PRI0_R & ~0xE0)|0x000000E0; //priority 0(CAUSE PASUE)
  NVIC_EN0_R |= 0x00000001;      //enable interrupt 30 in NVIC
}


//send data to pause game
void GPIOPortA_Handler(void){
	//acknowledge flag
	GPIO_PORTA_ICR_R = pause_button;
	//send the data for pause to MC1
	UART_OutChar(0x2);
	UART_OutChar('P');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar(0x3);
	Heartbeat();
}
	

int main(void){
	//create list of songs and their sizes
	const uint8_t* Song_List[9] = {Theme,      Bullet_Bill, Jump,      Coin,      Mario_Die,  Button, Special, Victory, Land};	//give ptr value to song structures?
	const uint32_t Song_Size[9] = {Theme_Size, Bullet_Size, Jump_Size, Coin_Size, Death_Size, Button_Size,    Special_Size, Victory_Size, Land_Size};
	//array to consume FiFo junk
	char Song_Num[4];
	//current song and song variable cause why not
	uint32_t Song = 0;
	
	//init all stuff
  TExaS_Init();  // set system clock to 80 MHz
  
	Heartbeat_Init();
	UART_Init();
	Button_Init();
	Sound_Init();
  //SysTick_Disable();
	Sound_Play(Song_Size[0], Song_List[0]);
	//Timer0_Init(Song_Size[0], Song_List[0]);
	
	//main loop:
	//check UART, play song, check for button press
	//add check for sound effect and add Timer for Sound effect play
	while(1){
		//poll for input on PA3-4 (Swap Player and main menu)
		
		//check Swap Player
		if(GPIO_PORTA_DATA_R & 0x8){
			UART_OutChar(0x2);
			UART_OutChar('S');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar(0x3);
			Heartbeat();
			while(GPIO_PORTA_DATA_R & 0x8){};
		}
		
		//check go to Main Menu
		if(GPIO_PORTA_DATA_R & 0x10){
			UART_OutChar(0x2);
			UART_OutChar('M');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar(0x3);
			Heartbeat();
			while(GPIO_PORTA_DATA_R & 0x10){};
		}
		if(GPIO_PORTA_DATA_R & 0x20){
			UART_OutChar(0x2);
			UART_OutChar('R');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar('0');
			UART_OutChar(0x3);
			Heartbeat();
			while(GPIO_PORTA_DATA_R & 0x20){};
		}
		
		//check if FiFo is full (has song num) and get value if it is
		if(FiFo_Get(Song_Num)){
			while(*Song_Num != 0x2){
			FiFo_Get(Song_Num);
			}
			FiFo_Get(Song_Num);
			Song = Song_Num[0];
			FiFo_Get(Song_Num);
			FiFo_Get(Song_Num);
			FiFo_Get(Song_Num);
			FiFo_Get(Song_Num);
			FiFo_Get(Song_Num);
			FiFo_Get(Song_Num);
		//check if sound changed 
			if (Song != 0){
			//change song playing by using Systick and TImer0a
				//if it is not theme song, play the sound effect
				Timer0_Init(Song_Size[Song], Song_List[Song]);
			}else if(Song == 0){
				Timer0A_Disable();
				SysTick_Enable();
				}
			}			
		}
	}
	


	

	
